__NUXT_JSONP__("/cestovatelsky-slovnik/enklava", (function(a){return {data:[{travelDictionary:[{id:8,slug:"enklava",created_at:"2023-07-15T09:41:51.269029+00:00",name:"Enkláva",description:"\u003Cp\u003EEnkláva je termín používaný k označení malého území, které je obklopeno územím jiného státu. Toto území je odděleno politicky, kulturně nebo geograficky od okolního území. Enklávy mohou být vytvořeny z různých důvodů, jako jsou historické události, dohody mezi státy nebo změny hranic.\u003C\u002Fp\u003E\n\u003Cp\u003EEnklávy se mohou vyskytovat na různých úrovních, od velkých regionálních území až po malé obce. Existují také enklávy, které jsou vytvořeny uměle, například vojenskými základnami nebo mezinárodními institucemi. Některé enklávy mají složitou politickou situaci, protože obyvatelé enkláv mohou být politicky příslušní ke státu, který je obklopuje, a přitom žít na území jiného státu.\u003C\u002Fp\u003E\n\u003Cp\u003EPříkladem enklávy je San Marino, které je enklávou v Itálii. San Marino je samostatný stát, který je zcela obklopen italským územím. Dalším příkladem je Kodaňská enkláva, která se nachází na území Švédska a je enklávou Dánska. Existují i složitější případy enkláv, kdy malá enkláva může být obklopena větší enklávou, která je pak obklopena dalším státem.\u003C\u002Fp\u003E",id_image_cover:a,id_image_hero:a,seo_tags:a,updated_at:"2023-12-27T17:08:03.040177+00:00"}],imageTravelDictionary:a}],fetch:{"OrganismsoSidebarListTravelDictionaryComponent:0":{_error:{message:"Cannot read properties of undefined (reading 'status')",statusCode:500}}},mutations:[]}}(null)));